window.bookSummaryJSON = "<p><b>A guide to self-remembrance with practices, meditations, and self-inquiry questions inspired by yoga and Tantra to help you connect with your inner wisdom, remember your wholeness, and live with clarity and compassion—by the bestselling author of </b><b><i>Radiant Rest</i></b><b>.</b></p> <p><i>The Luminous Self</i> shares teachings and practices that can help us connect with our true Self and reclaim our inherent power and wisdom—essential for living with purpose and grace in our turbulent world. In this book, Tracee Stanley shares teachings and practices in each chapter—including meditation, yoga nidra, breath work, dreaming rituals, community care practices, journaling, and more—that can help us remember and honor our deepest Self.</p> <p>The book is a journey of inner exploration for anyone who desires to know themselves more deeply. Chapters introduce different paths to personal discernment—including facing obstacles to liberation, forgiveness, the power of memory, transitions as portals to wisdom and devotion, and nature as a teacher—and include stories from Stanley's life, teachings, and practice. 6 audio practices accompany the book.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
